/**
 * @param {number[]} nums
 * @return {void} Do not return anything, modify nums in-place instead.
 */
// 超时
var moveZeroes = function (nums) {
    let len = nums.length
    for (let j = 0; j < len; j++) {
        for (let i = 0; i <= len; i++) {
            if (nums[i] === 0) {
                nums.splice(i, 1)
                nums.push(0)
            }

        }
    }
    return nums
};

var moveZeroes02 = function (nums) {
    let len = nums.length
    let j = 0
    for (let i = 0; i < len; i++) {
        if (nums[i] !== 0) {
            nums[j++] = nums[i]
        }
    }
    console.log(j, nums)
    for (let i = j; i < len;++i)  {
        nums[i] = 0
    }
    return nums
};


